import React from 'react';
import { Container, Button } from 'react-bootstrap';
import Header from './Header';
import HeroSection from './HeroSection';
import ServicesSection from './ServicesSection';
import Footer from './Footer';

const services = [
  { icon: 'public/dercarga.png', title: 'Ayuda Diagnóstica' },
  { icon: 'public/dercarga.jpg', title: 'Hospitalización' },
  { icon: 'public/vacuna.jpg', title: 'Urgencias 24 Horas' },
  // Agrega más servicios según sea necesario
];
const HomePage = () => {
  return (
    <>
      <Header />
      <HeroSection />
      <Container className="text-center my-5">
        <h1>Bienvenido a la Veterinaria</h1>
        <Button href="/citas" variant="primary" className="m-2">Gestionar Citas</Button>
        <Button href="/historias-clinicas" variant="secondary" className="m-2">Gestionar Historias Clínicas</Button>
        <Button href="/propietarios" variant="success" className="m-2">Gestionar Propietarios</Button>
        <Button href="/mascotas" variant="info" className="m-2">Gestionar Mascotas</Button>
        <Button href="/servicios" variant="warning" className="m-2">Gestionar Servicios</Button>
      </Container>
      <ServicesSection />
      <Footer />
    </>
  );
};

export default HomePage;
